review:
SNS 에 소문이 자자하여 어른3, 아이2 출동했어요.
여기는 돌판짜장이 중, 대 밖에 없어 주문하기가 조금 애매해용. 소 자부터 있음 참 좋을텐데요^^;
어른3, 아이2 이라 대자 하나 군만두하나 그리고 공기밥 두그릇을 시켜 비비니.. 싱거웠어요ㅠ
짜장소스만 더 부탁드리기도 죄송하고 그리고 조금 달아야 맛있는데 그렇지도 않고  이래저래 소문만큼
만족스럽진 못했네요..
그냥 울동네 중국집이 더 낫다는 결론입니다^^;

점심시간때 지나가다 습관적으로 칼국수시키고 나니 아차 여긴 인천이구나 생각이들었다
인천지역 칼국수는 빨간 다대기가 아니라  간장에 삭힌 풋고추 양념장이 나오는데 내취향엔 별로 이고 면발도 덜익은 밀가루냄새가 나서  비추;
더이상은  인천에와서 칼국수 먹을일은 없을듯

냉면 맛있고 양 엄청납니다.
그런데 고기육수도 아닌,분식집 냉면 같은 맛인데,만원이나 합니다.
새콤달콤 하게 먹는 그런...;;

부대라면: 양파, 샐러드용 햄?, 양배추, 콩나물이 들어간 밍밍한 맛.
떡볶이: 맛없음;;

나름 동네에서 오래된 음식점인데 맛이 없어도 너무 없음.

중국인분들이 주방에서 이런저런얘기를하던데 음식은본지사람들이만드는구나 바로알수가있겠더라구요.
고수맛이 은은하게나는듯하나 씹었을시엔 안좋아하는분들은 깜짝놀랄꺼예요 ^^;
맛은 현지맛일것같은? 그런맛이나고 국물은괜찮았어요. 밥은 따로추가가않되니 참고하세요. 다음번엔 전 안갈것같네요.
